import React from "react";

const StockInfo = ({ c, o, h, v}) => {
    return (
        <div>
            <p>Close: {c}</p>
            <p>Open: {o}</p>
            <p>High: {h}</p>
            <p>Volume: {v}</p>
        </div>
    );
};

export default StockInfo;
